#include "image.h"

void DrawBMP(int x, int y, const BMP* image, char transparantColor)
{
	int width = image->width;
	int height = image->height;
	int i,j;
	for(i = 0; i < width; i++)
	{
		for(j = 0; j < height; j++)
		{
			char color = image->iBMP[i + j*width];
			if(color != transparantColor || transparantColor == 0)
				DrawPixel(x+i,y+j,color);
		}
	}
}
void DrawBackGround(const BMP* image, BGSTYLE style)
{
	int width = image->width;
	int height = image->height;
	int i,j;
	if(style == fill)
	{
		float xRatio = width/320.0;
		float yRatio = height/240.0;

		for(i = 0; i < 320; i++)
		{
			for(j = 0; j < 240; j++)
			{
				int imageX = i*xRatio;
				int imageY = j*yRatio;
				DrawPixel(i,j,image->iBMP[(int)(imageX + imageY*width)]);
			}
		}
	}
	else if(style == tiled)
	{
		for(i = 0; i < 320; i++)
			{
				for(j = 0; j < 240; j++)
				{
					int imageX = i % width;
					int imageY = j % height;
					DrawPixel(i,j,image->iBMP[(int)(imageX + imageY*width)]);
				}
			}
	}
}
